import React from "react";
import extracy from "./extracy_logo.png";
import { Grid } from "semantic-ui-react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCoffee } from "@fortawesome/free-solid-svg-icons";

const headingTextStyle = {
  color: "white",
  marginBottom: "3vh",
  marginRight: "0vw",
};

const iconStyle = {
  color: "white",
};

const RightPanel = () => {
  return (
    <div>
      <Grid>
        <img
          src={extracy}
          alt=""
          style={{
            position: "relative",
            top: "20vh",
            left: "6vw",
            width: "55vw",
          }}
        ></img>

        <Grid.Row
          style={{
            top: "45vh",
            left: "7vw",
          }}
        >
          <Grid columns={4}>
            <Grid.Row>
              <Grid.Column style={headingTextStyle}>
                <Grid.Row style={headingTextStyle}>
                  <h5>Address:</h5>
                </Grid.Row>
                <Grid.Row style={headingTextStyle}>605 Robson St,</Grid.Row>
                <Grid.Row style={headingTextStyle}>Vancouver, </Grid.Row>
                <Grid.Row style={headingTextStyle}>BC, V6B 5J3</Grid.Row>
              </Grid.Column>
              <Grid.Column>
                <Grid.Row style={headingTextStyle}>
                  <h5>Tel:</h5>
                </Grid.Row>
                <Grid.Row style={headingTextStyle}>+1 (604) 688 2337</Grid.Row>
              </Grid.Column>
              <Grid.Column>
                <Grid.Row style={headingTextStyle}>
                  <h5>Email:</h5>
                </Grid.Row>
                <Grid.Row style={headingTextStyle}>
                  <a href="info@lawfoundationbc.org" style={{ color: "white" }}>
                    info@lawfoundationbc.org
                  </a>
                </Grid.Row>
              </Grid.Column>
              <Grid.Column style={{ marginRight: "0vw" }}>
                <Grid>
                  <Grid.Column width="4">
                    <Grid.Row style={{ marginBottom: "2vh" }}>
                      {/* <i
                        className="big world icon"
                        style={{ width: "10vw", color: "white" }}
                      ></i> */}
                      <FontAwesomeIcon icon="faCoffee" />
                    </Grid.Row>
                    <Grid.Row style={{ marginBottom: "2vh" }}>
                      <i
                        className="big linkedin icon"
                        style={{ width: "10vw", color: "white" }}
                      ></i>
                    </Grid.Row>
                  </Grid.Column>
                  <Grid.Column>
                    <Grid.Row style={{ marginBottom: "2vh" }}>
                      <i
                        className="big linkedin icon"
                        style={{ width: "10vw", color: "white" }}
                      ></i>
                    </Grid.Row>
                    <Grid.Row style={{ marginBottom: "2vh" }}>
                      <i
                        className="big linkedin icon"
                        style={{ width: "10vw", color: "white" }}
                      ></i>
                    </Grid.Row>
                  </Grid.Column>
                </Grid>
              </Grid.Column>
            </Grid.Row>
          </Grid>
        </Grid.Row>
      </Grid>
    </div>
  );
};

export default RightPanel;
